  false,\n\t\"url\": null,\n\t\"notes\": \"Information about dive activities were
  recorded into the Cruise Information Management System (CIMS) by the NOAA Office
  of Ocean Exploration's data manager during the \"Life on the Edge 2005\" expedition,
  October 16 through November 4, 2005. Information contained in CIMS includes submersible,
  remotely operated vehicle, autonomous underwater vehicle, and SCUBA operational
  information and a summary of scientific observations during each dive; ship activity
  information (positions, transits, and visitor shuttles); sample information; water
  column and bottom conditions; weather observations; sea state observations; education
  and outreach activity information; media event information; scientific instrumentation
  information; transect information; dive site profiles; and a record of all data
  collected by principal investigators. The data presented here are the tables from
  the original CIMS which is a FileMaker Pro database.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
